INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "ここに困ってる人は\nいないよね…？\nよかった♪", 1, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 2, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 3, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 4, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 5, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 6, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100101, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 7, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 8, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 9, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "えっとね…しっぽは\n触っちゃダメだよ？", 10, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 11, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 12, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100101, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 13, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100101, "おはよー！\n今日も元気に\nいっちゃうよー！", 14, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100101, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 15, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100101, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 16, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "ちゃんとケアして\n傷が残らないように\nしないと…", 17, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "一回休むと\nこのままずるずる\nいきそう…", 18, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 19, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 20, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "あったかい所に\nいると体が丸く\nなっちゃう…", 21, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 22, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 23, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100101, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 24, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 26, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 27, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 28, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 29, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 30, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 31, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100102, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 32, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 33, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 34, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 35, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 36, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 37, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100102, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 38, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100102, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 39, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100102, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 40, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100102, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 41, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "これでよし♪\n騎士くん\n気づくかな…？", 42, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "一回休むと\nこのままずるずる\nいきそう…", 43, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 44, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 45, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "あったかい所に\nいると体が丸く\nなっちゃう…", 46, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 47, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "お腹が減ると\nなんか力が\n出ないんだよね…", 48, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100102, "色んなことを\n知っておくのは\n大事だよね！", 49, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 51, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 52, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 53, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "戦いは\n得意じゃないけど\nお料理なら…！", 54, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "こういう平和な\n時間が、もっと\n続くといいな", 55, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 56, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100201, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 57, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 58, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 59, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "困ったことが\nあったら\nいつでも話してね", 60, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "え！　む、虫っ！？\n取って取って！\nはやく～！", 61, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 62, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100201, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 63, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100201, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 64, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100201, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 65, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100201, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 66, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "よし…\nこれなら\n褒めてもらえるかな？", 67, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "がんばることも\n必要だけど、\nお休みも大切だよね", 68, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 69, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "戦う前にもこうやって\n落ち着けたら\nいいのに", 70, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 71, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 72, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 73, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100201, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 74, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "洗濯と掃除\nどっちから\nはじめよう？", 76, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 77, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 78, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "今日はどんな料理に\n挑戦しよう…♪", 79, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 80, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 81, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100202, "騎士クンのそばに\nいられるだけで\n幸せだよ", 82, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 83, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "え！　む、虫っ！？\n取って取って！\nはやく～！", 84, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 85, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 86, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 87, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100202, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 88, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100202, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 89, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100202, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 90, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100202, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 91, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "よし…\nこれなら\n褒めてもらえるかな？", 92, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "がんばることも\n必要だけど\nお休みも大切だよね", 93, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "かわいい～♪\n騎士クンは\nこういうのって好き？", 94, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "戦う前にもこうやって\n落ち着けたら\nいいのに", 95, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "あの…！\nよ、良かったら\n一緒に…！", 96, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 97, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 98, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100202, "…やっぱり\n月刊恋愛指南は\nためになる…", 99, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "装備の手入れでも\nしようかな…", 101, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 102, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 103, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "仲間なんていらない\nそう思ってた頃も\nあったな…", 104, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 105, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "彼は\nどこまで強くなるのか\n私も負けられないな", 106, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100301, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 107, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 108, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 109, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "なに？　私に相談？\n戦いについてなら\n喜んで", 110, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 111, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 112, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100301, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 113, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100301, "おはよう\n今日も充実した\n一日にしていこう", 114, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100301, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 115, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100301, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 116, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 117, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 118, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 119, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 120, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 121, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 122, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 123, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100301, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 124, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 126, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 127, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "彼は\nどこまで強くなるのか\n私も負けられないな", 128, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 129, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 130, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 131, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100302, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 132, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "どうしたの？\nなんでもない？\nそれなら良かった", 133, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 134, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 135, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 136, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "ひょっとして\n今のも一本だなんて\n言わないよね？", 137, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100302, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 138, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100302, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 139, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100302, "休息も時には\n必要だと、仲間から\n教わったよ", 140, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100302, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 141, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 142, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "休息があってこそ\n万全な状態で\n戦えるんだ", 143, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 144, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "体と同様に\n心もほぐれるね…\nはぁ…", 145, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 146, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 147, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "修行のせいか\n最近食べる量が\n増えてきたような…", 148, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100302, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 149, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 151, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "落とし穴…どこに\n作ったんだっけ？", 152, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 153, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 154, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "かくれんぼする人\nこの指、と～まれ！", 155, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 156, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100401, "ミソギと遊ぶ？\nミソギに遊ばれる？", 157, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 158, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 159, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 160, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 161, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "ここ、ミソギ探検隊の\n基地にしようよ！", 162, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100401, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 163, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100401, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 164, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100401, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 165, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100401, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 166, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "イタズラには\nお色気も必要…\nうん、完璧！", 167, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 168, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 169, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 170, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 171, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "探検家は\n体力勝負だよー！", 172, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 173, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100401, "こういう所に\n宝の地図が\n隠れてるんだよね～", 174, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 176, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 177, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 178, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 179, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "かくれんぼする人\nこの指、と～まれ！", 180, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 181, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100402, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 182, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 183, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 184, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "将来の夢は探検家！\n探したい物はないけど", 185, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 186, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 187, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100402, "ここ、ミソギ探検隊の\n基地にしようよ！", 188, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100402, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 189, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100402, "にいちゃんが昼寝したら\nイタズラし放題♪", 190, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100402, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 191, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "イタズラには\nお色気も必要…\nうん、完璧！", 192, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 193, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 194, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 195, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 196, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "探検家は\n体力勝負だよー！", 197, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "探検のおやつに\nぴったりかも～！", 198, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100402, "こういう所に\n宝の地図が\n隠れてるんだよね～", 199, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 201, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 202, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 203, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "お姉ちゃんのマネ\nしちゃおうかな？", 204, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "双子って、\n好みのタイプも\n似ちゃうのかな？", 205, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "お兄ちゃんと私は\n相性抜群です♪", 206, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100601, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 207, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 208, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 209, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "そんなところ\n触っちゃダメ♪", 210, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "お兄ちゃん、イジワル\nしないでください…", 211, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 212, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100601, "コーチ、\n今日も特訓\nお願いします！", 213, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100601, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 214, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100601, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 215, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100601, "夜はこれからですよ\nお兄ちゃん♪", 216, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "世界一、かわいく\nなるんだから♪", 217, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "気持ちいい♪\nもう立てないよ～", 218, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "かわいい♪\nアカリのライバル\nだね", 219, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 220, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "はぁ…アカリ、\nとろけちゃう…", 221, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 222, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 223, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100601, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 224, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 226, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 227, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 228, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 229, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "双子って、\n好みのタイプも\n似ちゃうのかな？", 230, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 231, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100602, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 232, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 233, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 234, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 235, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "お兄ちゃん、イジワル\nしないでください…", 236, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 237, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100602, "コーチ、\n今日も特訓\nお願いします！", 238, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100602, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 239, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100602, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 240, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100602, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 241, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "お姉ちゃんのマネ\nしちゃおうかな？", 242, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "気持ちいい♪\nもう立てないよ～", 243, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "かわいい♪\nアカリのライバル\nだね", 244, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 245, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 246, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "汗をかくと\n気持ちいいですよね", 247, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 248, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100602, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 249, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 251, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "う～ら～め～し～や～\nなの～♪", 252, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 253, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "幽霊の正体見たり、\nミヤコなの～", 254, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 255, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 256, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100701, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 257, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 258, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 259, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 260, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 261, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 262, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100701, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 263, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100701, "う～　眠いの…\n二度目の二度寝を\nするの…", 264, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100701, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 265, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100701, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 266, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "体が透けちゃうから\nうまく使えないの～", 267, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 268, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "む～…かわいいけど\nプリンは分けて\nあげないの～", 269, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "は～　いい気分なの…\n成仏しそうなの…", 270, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 271, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "幽霊には、体力も\n筋力も関係ないの～！", 272, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 273, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100701, "プリンの写真集が\nあればいいのに\nなの～", 274, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "うらめしや～…\n裏の飯より\nプリンがいいの～", 276, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "プリン♪　プリン♪\nプリン♪　なの～♪　", 277, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 278, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 279, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 280, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "アイツがいて\nプリンもある\nきっとここが天国なの", 281, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100702, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 282, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 283, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 284, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 285, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 286, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 287, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100702, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 288, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100702, "う～　眠いの…\n二度目の二度寝を\nするの… ", 289, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100702, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 290, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100702, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 291, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "体が透けちゃうから\nうまく使えないの～ ", 292, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 293, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 294, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "は～　いい気分なの…\n成仏しそうなの…", 295, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 296, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "幽霊には、体力も\n筋力も関係ないの～！　", 297, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 298, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100702, "プリンの写真集が\nあればいいのに\nなの～ ", 299, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 301, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 302, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 303, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 304, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 305, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "このボクがいるだけで\nあの人への\nおもてなしだよね", 306, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100801, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 307, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 308, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 309, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 310, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 311, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 312, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100801, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 313, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100801, "美しいボクの\n美しい一日が\n始まるよ！", 314, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100801, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 315, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100801, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 316, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 317, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 318, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 319, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 320, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 321, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 322, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 323, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100801, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 324, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "ボクの美しさは\nみんなのために\nあるんだよ！", 326, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 327, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 328, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 329, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 330, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "このボクがいるだけで\nあの人への\nおもてなしだよね", 331, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100802, "あの人も今\n可愛いボクのこと\n考えてるかな…", 332, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 333, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 334, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 335, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 336, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 337, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100802, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 338, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100802, "朝日と共に\nボクの美しさも\n周りを照らすよ", 339, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100802, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 340, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100802, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 341, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 342, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 343, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 344, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 345, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 346, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 347, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "ボクが食べると\n食べ物まで\n可愛いなあ…", 348, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100802, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 349, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 351, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 352, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "ここでは風が\n吹いてこないな…\n換気したい！", 353, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 354, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 355, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "シグルド…\n今頃何処で何を\nしているのだろう…", 356, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100901, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 357, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "辞書を知らないか？\n…探している\n理由は聞くな", 358, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 359, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 360, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 361, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 362, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100901, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 363, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100901, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 364, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100901, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 365, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100901, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 366, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 367, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 368, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "このようなものに\n懐柔されるものか！\n…されるものか！", 369, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 370, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "これが我らの求めた\n安寧か…\n悪くない…", 371, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "この程度\n前世での激闘に\n比べれば…！", 372, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "最近金欠でな…\nいやぁありがたい…", 373, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100901, "ここにも\n前世の記憶が\n眠っていたとは…", 374, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 376, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 377, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 378, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 379, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 380, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 381, 1, 1, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 100902, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 382, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 383, 1, 8, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 384, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 385, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 386, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 387, 1, 1, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 100902, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 388, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 100902, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 389, 1, 8, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 100902, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 390, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 100902, "夜になると、力が\n増した気分になるな\n…なりませんか？", 391, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 392, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 393, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 394, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 395, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "これが我らの求めた\n安寧か…\n悪くない…", 396, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 397, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "食事は魔力に\n変換する体力の\n元になるのだ！", 398, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 100902, "フフフ…\nこれを覚えれば\nもっと強く…！", 399, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 401, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 402, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 403, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 404, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 405, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 406, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101001, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 407, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 408, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 409, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "王子はんは、\n絵本から出てきた人\nみたいやね～", 410, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "うちの話し方\nのんびりしてます\nやろか？", 411, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 412, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101001, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 413, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101001, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 414, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101001, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 415, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101001, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 416, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 417, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 418, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 419, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "心地ええどす。まるで\nお花畑にいるようやね", 420, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 421, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 422, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 423, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101001, "絵本、絵本～\n幸せやわぁ♪", 424, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "王子はんにとって\n自慢の姫になるえ～", 426, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 427, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 428, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 429, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 430, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 431, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101002, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 432, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 433, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 434, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 435, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "絵本読むんも\nええなぁ…", 436, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 437, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101002, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 438, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101002, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 439, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101002, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 440, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101002, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 441, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 442, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 443, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 444, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "癒しアイテムって\nほんま、好っきゃわぁ", 445, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 446, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 447, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 448, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101002, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 449, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 451, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 452, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "い、いけない！\n縫い針落としちゃった", 453, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 454, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 455, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 456, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101101, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 457, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 458, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 459, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "勉強、見てくれるん\nですか？　やった～♪", 460, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "服がほつれてますよ？\n直してあげます！", 461, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 462, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101101, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 463, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101101, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 464, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101101, "お昼休憩に\n甘いものが\n食べたいです～", 465, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101101, "ねむいです～\nでももうちょっと\n勉強しないと～…", 466, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "この服、かわいい♪\n今度作って\nみよっと～！", 467, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "勉強で疲れたから\n休憩しよ～っと", 468, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "かわいい♪\n私が服を作って\nあげよっか？", 469, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 470, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "のんびりしたら、\nまた勉強しよっと！", 471, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "運動すると勉強も\nはかどるよね！", 472, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 473, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101101, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 474, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 476, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 477, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "い、いけない！\n縫い針落としちゃった", 478, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "笑う時には服着ます！", 479, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 480, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 481, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101102, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 482, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "勉強、見てくれるん\nですか？　やった～♪", 483, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 484, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 485, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "勉強は…\n明日にしようっと", 486, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "妹だけど、大人な\nレディですからね！", 487, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101102, "な、ナデナデとか\n恥ずかしいな～", 488, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101102, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 489, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101102, "お昼休憩に\n甘いものが\n食べたいです～", 490, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101102, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 491, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "服装や髪形が変わると\n気分も変わるよね", 492, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 493, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "かわいい♪\n私が服を作って\nあげよっか？", 494, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "いまならどんな試験も\n合格できそうです！", 495, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "のんびりしたら\nまた勉強しよっと！", 496, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 497, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 498, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101102, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 499, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 501, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 502, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "…はっ！？\nね、寝てないよ？\nホントだよっ", 503, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 504, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "もし、超能力のことが\nバレたら…ブルブル", 505, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 506, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101201, "キミを抱き枕に…\nじょ、冗談冗談！", 507, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "ん～、なになに？\n一緒にお昼寝する？", 508, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 509, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "おおっ、相談ごと？\nなにかな\nなにかな～？", 510, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 511, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 512, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101201, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 513, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101201, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 514, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101201, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 515, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101201, "どんなにお昼寝しても\n夜は眠いんだ～", 516, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 517, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 518, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "これ…可愛い！\nシオリンに\n届けてあげたい！", 519, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 520, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 521, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "眠くならないように、\n運動しよっと！", 522, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "お腹いっぱいになると\n眠くなるよね～", 523, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101201, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 524, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 526, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "もっといっぱい\n超能力使えたら\nいいのにな～", 527, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 528, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 529, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 530, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 531, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101202, "キミを抱き枕に…\nじょ、冗談冗談！", 532, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 533, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 534, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "一緒に\nお出かけしたいなー\nデートしよっ！", 535, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 536, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 537, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101202, "う～だんだん眠く…\nねぇ一緒に寝よ？", 538, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101202, "キミって早起きだね！\n私は寝ようかな～", 539, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101202, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 540, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101202, "どんなにお昼寝しても\n夜は眠いんだ～", 541, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 542, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 543, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "これ…可愛い！\nシオリンに\n届けてあげたい！", 544, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 545, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 546, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "よーし\n困ってる人のために\nパワーアップ☆", 547, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 548, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101202, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 549, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 551, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 552, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 553, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "ここで撮影会、\nしようかな～♪", 554, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 555, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "やば…\nこのままじゃ、うち\nキュン死にかも…", 556, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101601, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 557, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "うちの写真撮るの？\nどんなポーズ？", 558, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 559, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "宿題見てくんない？\nひとりじゃムリ～", 560, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 561, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 562, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101601, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 563, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101601, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 564, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101601, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 565, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101601, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 566, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 567, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 568, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "きゃわたーん☆\n君もおしゃれしよっか", 569, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 570, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 571, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 572, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 573, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101601, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 574, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 576, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 577, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 578, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "体形維持とか\n気にしてるんだよ～", 579, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 580, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 581, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101602, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 582, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "うちの写真撮るの？\nどんなポーズ？", 583, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 584, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "この雑誌の服\nガチめにほしぃ～", 585, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 586, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 587, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101602, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 588, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101602, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 589, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101602, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 590, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101602, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 591, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 592, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 593, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 594, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 595, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 596, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "食べた分は\n消費しないとね～", 597, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 598, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101602, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 599, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 601, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 602, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "ハイターイ！　元気な\nあいさつが一番さ～！", 603, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 604, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "さぁ、みんなで歌って\n踊るさ～♪", 605, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "毎日、最高に幸せさ～\nキミのおかげだねー", 606, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101701, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 607, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 608, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 609, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 610, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "空手の型の\n練習するさー\nキミもどう？", 611, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 612, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101701, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 613, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101701, "ハイターイ！\n今日も一日、\nがんばるさー！", 614, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101701, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 615, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101701, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 616, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 617, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 618, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 619, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 620, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 621, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 622, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 623, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101701, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 624, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 626, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "さぁ、みんなで歌って\n踊るさ～♪", 627, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "元気がないときは\n私のところに来るさー", 628, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 629, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 630, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "毎日、最高に幸せさ～\nキミのおかげだねー", 631, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101702, "幸せすぎて踊らずには\nいられないさ～", 632, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 633, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 634, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 635, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "ハイターイ！　元気な\nあいさつが一番さ～！", 636, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 637, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101702, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 638, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101702, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 639, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101702, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 640, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101702, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 641, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 642, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 643, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 644, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 645, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 646, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 647, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "もぐもぐ…もっと\nおかわりがほしいさー", 648, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101702, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 649, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 651, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 652, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 653, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "キンコンカンコ～ン♪\n授業をはじめま～す", 654, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "はー…\nちょっと肩が\nこっちゃった…", 655, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 656, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101801, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 657, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 658, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 659, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 660, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 661, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 662, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101801, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 663, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101801, "学校に\n遅刻しないように\n早く準備しないとね", 664, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101801, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 665, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101801, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 666, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "もしかして…\n少し露出多いかしら？", 667, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 668, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "かわいい♪　あなたも\n私の生徒になる？", 669, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 670, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 671, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "運動部の顧問も\nできるかしら？", 672, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "学校の給食でも\n食べたいわぁ～", 673, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101801, "いい参考書を\n見つけちゃった♪", 674, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 676, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 677, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 678, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 679, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 680, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 681, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 101802, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 682, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 683, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 684, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 685, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 686, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 687, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 101802, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 688, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 101802, "朝の特別授業\nしてあげましょうか？", 689, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 101802, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 690, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 101802, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 691, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "もしかして…\n少し露出多いかしら？", 692, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "私の膝枕と、どっちが\nフカフカかしら？", 693, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 694, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 695, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 696, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "運動部の顧問も\nできるかしら？　", 697, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "あん！\nお胸にこぼしちゃった", 698, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 101802, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 699, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "おにいちゃんは、\nにんじん食べられる？", 701, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "えへへ、\nお絵かきしよ～♪", 702, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "あのね、ミミと\nあそんでほしいな～", 703, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 704, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 705, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "おにいちゃんの絵、\nかいてあげるね♪", 706, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102001, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 707, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102001, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 708, 1, 1, 1);
