INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102102, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪", 795, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102102, "えへへ\nぽっかぽかです…", 796, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102102, "え、演劇には\nた、体力も重要\nだから～", 797, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102102, "残さず\n食べますね…！", 798, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102102, "戯曲を読んで\n自分が演じるところを\n想像するの…", 799, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 801, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 802, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 803, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 804, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "楽しいゲームって\nやめどきが\n見つからないわ", 805, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 806, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102201, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 807, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 808, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 809, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 810, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 811, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 812, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102201, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 813, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102201, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 814, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102201, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 815, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102201, "夜はこれからよ！\n朝まで\nゲームするからね！", 816, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "アカリみたいに\n可愛くなるのは\n難しいかな", 817, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 818, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "可愛い…けど、\n私には似合わないかな", 819, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "はあ、リラックスして\nゲームができるわ", 820, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "ん…暖かくて、\n寝落ちしちゃいそう", 821, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 822, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 823, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102201, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 824, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 826, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 827, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "レアカードをゲット！\nすごいでしょ！？", 828, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 829, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "楽しいゲームって\nやめどきが\n見つからないわ", 830, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 831, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102202, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 832, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 833, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 834, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "ねえ、見て！\n新しいゲームを\n買って来たの！", 835, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 836, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 837, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102202, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 838, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102202, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 839, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102202, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 840, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102202, "夜はこれからよ！\n朝まで\nゲームするからね！", 841, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 842, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 843, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "可愛い…けど、\n私には似合わないかな", 844, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 845, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 846, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "最近ゲームばかりだし\nたまにはいいかな？", 847, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 848, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102202, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 849, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 851, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 852, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 853, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 854, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "この部屋、ぷうきちを\n置く場所はないのかな", 855, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 856, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102301, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 857, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 858, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 859, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 860, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 861, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 862, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102301, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 863, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102301, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 864, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102301, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 865, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102301, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 866, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 868, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 869, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 870, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 871, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "おいしい～\nぷうきちも\n食べてみる？", 873, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102301, "ぷうきち！\nこの本、読んで～！", 874, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 901, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 902, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "どうしたら転ばなく\nなるんでしょうか？", 903, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 904, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 905, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "おいしい料理で\nお出迎えしなくちゃ！", 906, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102501, "一生懸命\nご奉仕しますよ～♪", 907, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "耳かきしましょうか？\nえ？　こわい？", 908, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 909, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "おかえりなさいませ\nご主人さま♪", 910, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "すみません\nすみません\nすみません～～", 911, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 912, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102501, "私のこと、\n専属メイドと思って\n頼ってくださいね", 913, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102501, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 914, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102501, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 915, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102501, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 916, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 917, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 918, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "かわいい♪\nあとでお洗濯\nしてあげますね", 919, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 920, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "ここでお洗濯ものを\n乾かしましょうか", 921, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "あわわわっ…\nこ、転びそうです～！", 922, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "これくらい\nおいしいものを\n作ってみたいです～", 923, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102501, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 924, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 926, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 927, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "どうやったら、立派な\nメイドになれるのかな", 928, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 929, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "ご用があれば\nなんでも言って\nくださいね", 930, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 931, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102502, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 932, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 933, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 934, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "私、またなにか\nやっちゃいましたか？", 935, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 936, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "転んだふりであの人に\n…って！\nなんでもないですよ！", 937, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102502, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 938, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102502, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 939, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102502, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 940, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102502, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 941, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 942, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 943, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "かわいい♪\nあとでお洗濯\nしてあげますね", 944, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 945, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 946, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "運動しようとすると\nいつも怪我するん\nですよね…", 947, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 948, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102502, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 949, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "あの方と私だけの\n部屋にしたいですわ", 951, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 952, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 953, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "部屋からあの方の\n香りが…\nああ、至福ですわ", 954, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 955, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 956, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102701, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 957, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 958, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 959, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "お願いがあるのです。\n新しい研究の実験台に\n…", 960, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 961, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 962, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102701, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 963, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102701, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 964, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102701, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 965, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102701, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 966, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 967, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "はっ！\nリラックスしたら\n閃きましたわ！", 968, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "あら、キメラの素体に\nぴったりですわ", 969, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 970, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "あたたかい…\n加熱調合にも\n使えそうですわね", 971, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 972, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 973, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102701, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 974, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "あの方と私だけの\n部屋にしたいですわ", 976, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 977, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "新しい薬\nどうやってあの方に\n飲ませようかしら", 978, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "部屋からあの方の\n香りが…\nああ、至福ですわ", 979, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 980, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 981, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102702, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 982, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 983, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 984, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "お願いがあるのです\n新しい研究の\n実験台に…", 985, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 986, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 987, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102702, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 988, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102702, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 989, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102702, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 990, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102702, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 991, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "私ももう少し\n外見に気を配る\nべきでしょうか…", 992, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "はっ！\nリラックスしたら\n閃きましたわ！", 993, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 994, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 995, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 996, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 997, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 998, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102702, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 999, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1001, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 1002, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 1003, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 1004, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1005, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1006, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102801, "焼きそばパンが\n食べたいな～\nあいつと…", 1007, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "ねぇあんた、どこか\n安いお店知らない？", 1008, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 1009, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 1010, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 1011, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 1012, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102801, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 1013, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102801, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 1014, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102801, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 1015, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102801, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 1016, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 1017, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "これで仕事は一段落ね\nちょっと休憩…", 1018, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "うふふ、\nかわいいものを\n見るのは幸せね～", 1019, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1020, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "風邪を引かないように\n身体を温めなくちゃ", 1021, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1022, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 1023, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102801, "知識から過去を学んで\n未来に活かすわよ", 1024, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "安売りのお店の情報\n整理しないと…", 1026, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 1027, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 1028, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1029, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1030, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "焼きそばパンが\n食べたいな～\nあいつと…", 1031, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102802, "あいつと一緒に…\n色々なところに\nいきたいな", 1032, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "今度買い物に\n付き合いなさい\nセールがあるのよ", 1033, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 1034, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 1035, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "あんたとこうして\nのんびりするのも\nいいものね", 1036, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 1037, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102802, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1038, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102802, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 1039, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102802, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 1040, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102802, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 1041, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 1042, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "これで仕事は一段落ね\nちょっと休憩…", 1043, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 1044, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1045, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "風邪を引かないように\n身体を温めなくちゃ", 1046, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1047, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "しっかり食べて\n栄養補給、栄養補給！", 1048, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102802, "知識から過去を学んで\n未来に活かすわよ", 1049, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1051, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 1052, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1053, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "彼とデュエット\nしてみたいな～♪", 1054, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 1055, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1056, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102901, "写真集見なくても、\n本物がここに\nいるのにな～", 1057, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "握手会の練習、\n付き合ってくれない？", 1058, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "写真集のポーズ\n練習中～！\nど、どうかな？", 1059, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 1060, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 1061, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 1062, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102901, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 1063, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102901, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1064, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102901, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 1065, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102901, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 1066, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1067, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1068, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1069, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 1070, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1071, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1072, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1073, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102901, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 1074, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1076, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 1077, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "みんながくれた\nファンレター…\n私の大事な宝物…", 1078, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "彼とデュエット\nしてみたいな～♪", 1079, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 1080, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1081, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 102902, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 1082, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1083, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 1084, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 1085, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 1086, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 1087, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 102902, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 1088, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 102902, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1089, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 102902, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 1090, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 102902, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 1091, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1092, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1093, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1094, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 1095, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1096, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1097, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1098, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 102902, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 1099, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1101, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1102, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 1103, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "むむ、アクダイカンの\n気配がするデース", 1104, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "クニトリ合戦、\n楽しみデース！", 1105, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "ショーグンと\n出会えて、\nワタシは果報者デス！", 1106, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103001, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1107, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 1108, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 1109, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 1110, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 1111, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1112, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103001, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1113, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103001, "おはようデス！\n今日も一日\n忍法日和デス！", 1114, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103001, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 1115, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103001, "明日もきっと\nいい日デスよ、\nショーグン！", 1116, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "ちょんまげに\nしてみるのも\n面白いかもデス！", 1117, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 1118, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1119, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1120, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "身体を暖めて\nイクサに向かうデス！", 1121, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 1122, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "うーん、\n美味しいデス…\n幸せデス～", 1123, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103001, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 1124, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1126, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1127, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 1128, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "むむ、アクダイカンの\n気配がするデース", 1129, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "クニトリ合戦\n楽しみデース！", 1130, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1131, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103002, "ショーグンの身は\n何があってもワタシが\n守るデス！", 1132, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 1133, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 1134, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 1135, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 1136, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1137, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103002, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1138, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103002, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 1139, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103002, "もうお昼デス\nお昼寝するデスか？", 1140, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103002, "そろそろおネム\nデース…\n一緒に寝るデス？", 1141, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 1142, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 1143, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1144, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1145, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "身体を暖めてイクサに\n向かうデス！", 1146, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 1147, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "美味しいデス…\n酢昆布を和えて\nみたいデス", 1148, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103002, "物事を知って\n来たるべきイクサに\n活かすデス", 1149, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1151, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "父は、いつも男性に\nきびしいですね", 1152, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "占ってほしい人は、\nいつでも言って\nください", 1153, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1154, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "この部屋、風水的にも\n運気が上がりそうです", 1155, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 1156, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103101, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1157, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "女難の相が\n出ていますね…\n気をつけてください", 1158, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "今日のあなたの運勢は\n大きょ…\n大吉です", 1159, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 1160, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 1161, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 1162, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103101, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 1163, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103101, "おはようございます\n今日の運勢を\n占いましょうか？", 1164, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103101, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1165, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103101, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 1166, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 1167, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "一休みしましょう。\n憑かれて疲れました", 1168, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "かわいい…\n付喪神が宿らないかな", 1169, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 1170, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "気持ちいいです…\n極楽浄土みたい…", 1171, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1172, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "お父さんも\n食べたいの？\n死んでるのに？", 1173, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103101, "この本…\nもしかして予言書？", 1174, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "ここにいる幽霊は\nみんな幸せそうです", 1176, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 1177, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 1178, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 1179, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1180, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 1181, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103102, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 1182, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "この部屋、風水的にも\n運気が上がりそうです", 1183, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "シノブには指一本\n触れさせん！\nガブッ！！", 1184, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1185, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "ラップ音？\nいえ、父のいびきです", 1186, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1187, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103102, "前世って信じますか？\n私とあなたは\nもしかすると…", 1188, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103102, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1189, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103102, "明るい時間は\nあまり得意では\nないんです…", 1190, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103102, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 1191, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 1192, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "うとうと…\nあれ…\n走馬灯が見える…", 1193, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "かわいい…\nお父さんみたい…", 1194, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 1195, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "快適です…\n幽霊もどんどん\n集まってきますね…", 1196, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1197, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "お父さんの分も、\n私が食べるね", 1198, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103102, "この本の占い\n私の占いと違う…", 1199, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1201, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1202, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "一日も早く、\n一人前の商人に\nなりたいものです", 1203, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1204, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1205, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1206, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103201, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1207, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1208, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "資産運用？\nお幾らほど\n増やしたいのです？", 1209, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 1210, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "お金で解決するのは\n悪いことでは\nありませんわよね？", 1211, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "その、よろしければ\n私とお散歩など\nいかがです？", 1212, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103201, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 1213, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103201, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1214, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103201, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1215, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103201, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1216, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1217, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 1218, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1219, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 1220, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1221, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 1222, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "なかなか\n美味ですわ\nシェフはどちらに？", 1223, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103201, "経済の仕組みを\nしっかりと\n学ばなくては…", 1224, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1226, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 1227, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 1228, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1229, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "この狭さも\n慣れれば\n快適ですわ♪", 1230, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1231, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103202, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1232, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1233, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 1234, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "資産運用？\nお幾らほど\n増やしたいのです？", 1235, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "今度一緒に…\nパーティにでも\n行きませんこと？", 1236, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "その、よろしければ\n私とお散歩など\nいかがです？", 1237, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103202, "あなたさまの優しさは\nお金には\n代えられませんわね", 1238, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103202, "なぜだか\n眠り足りないような\n感じがしますわ…", 1239, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103202, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1240, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103202, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1241, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1242, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 1243, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1244, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 1245, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1246, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "目標は遠くに\n置いた方が励みに\nなりますわ！", 1247, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "なかなか\n美味ですわ\nシェフはどちらに？", 1248, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103202, "商人って、物語では\n悪役にされやすいの\nですね…", 1249, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "家の中のものを使って\n物ボケ、考えるべ！", 1251, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1252, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "うちに塀ができたら、\nへー、って言いたい！", 1253, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1254, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "エリザベスも\n連れてきてぇ～", 1255, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 1256, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103301, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 1257, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1258, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 1259, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1260, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 1261, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1262, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103301, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 1263, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103301, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 1264, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103301, "お昼だ～腹が減っては\n笑いはできぬ～！", 1265, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103301, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 1266, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1267, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "ナイスなイスに\n座りたい、\nなんちゃって！", 1268, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "めんこいのは、\nスベっても許される\nからずるいべな～？", 1269, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "必要以上に\n癒されちまうべや～", 1270, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "ぽかぽかだ…\nウケた会場みてぇだ", 1271, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "お笑い芸人は、\n体が資本だべさ～！", 1272, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1273, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103301, "ネタ作りのヒントが\n載ってねぇか探すべ", 1274, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "さぁ今日も張り切って\n漫才の練習するべさ！", 1276, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "この部屋でも、商品\n売っていいんだべか？", 1277, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1278, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1279, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "エリザベスも\n連れてきてぇ～", 1280, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1281, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103302, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 1282, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1283, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "あんちゃん、百連\nツッコミ特訓だ～！", 1284, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1285, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 1286, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 1287, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103302, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 1288, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103302, "おはよう！\n今日もいい\nネタ作り日和だ！", 1289, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103302, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 1290, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103302, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 1291, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "うーん…衣装、\nずれてねぇべか？", 1292, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "ナイスなイスに\n座りたい\nなんちゃって！", 1293, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "はう～\nなまらめんこいべや～", 1294, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "必要以上に\n癒されちまうべや～", 1295, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "笑いをとることを\n忘れるほど\nあったけぇべ～", 1296, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 1297, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1298, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103302, "幅広く教養を\n身につけて\nいいネタ作るべ！", 1299, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "通りにいる\nカップル…爆発\nすればいいのに…", 1301, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1302, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "今日は一日、\n外に出ない！\nもう決めたわ！", 1303, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1304, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1305, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "デートとか…\n誘っても嫌がられ\nないかな…？", 1306, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103401, "もしかして運命の\n相手だったり…\nするのかな", 1307, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1308, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 1309, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 1310, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 1311, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1312, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103401, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 1313, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103401, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1314, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103401, "おっひるー♪\nなに食べよっかな～♪", 1315, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103401, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 1316, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1317, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1318, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "こういうの男の子に\nプレゼントして\nもらいたいな…", 1319, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "うわあ、\nこれ、私の好きな\n香りだー！", 1320, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 1321, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 1322, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "もぐもぐ…\nおーいしー！\n…太らないよね？", 1323, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103401, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1324, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1326, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "今日は\nのんびり\n過ごそうかな～", 1327, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "あ…\nお皿、洗って\nなかった…", 1328, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "もう少し、大人の\n魅力が出せるように\nなりたいな", 1329, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "素敵な彼氏…\n欲しいなぁ…", 1330, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "彼と私\n釣り合うかな…\n大丈夫よね？", 1331, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103402, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 1332, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1333, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 1334, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 1335, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "お姉さんが～\n可愛がって\nあげようか～？", 1336, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1337, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103402, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 1338, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103402, "さーて、今日も\nいっちょやるぞー！", 1339, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103402, "後でのんびり\nストレッチでも\nしようっと♪", 1340, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103402, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 1341, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "仕事の前に、髪とか\n整えないと…", 1342, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1343, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 1344, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "うわあ\nこれ、私の好きな\n香りだー！", 1345, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "あったかーい…\nだ、だらけ\nちゃいそう…", 1346, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "地道な努力が\nリア充への\n第一歩！", 1347, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "おーいしっ♪\nこのために\n生きてるわねえ", 1348, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103402, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1349, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1351, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1352, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1353, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "ちょっと、休憩…\n本でも読もうかな", 1354, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "もっとたくさんの本に\n囲まれて生活したいな", 1355, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "むかしむかしある所に\nシオリと\nあの人が…", 1356, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103801, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 1357, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1358, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "あ…お姉ちゃんと\n約束があったんだ…", 1359, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1360, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1361, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 1362, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103801, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1363, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103801, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1364, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103801, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 1365, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103801, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 1366, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "寝てばかりなので、\n髪が乱れてないかな\n…？", 1367, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "少し休もう\n…やっぱり\nたくさん休もう", 1368, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "かわいいものが\n枕元にあると\n安心できるんですよ", 1369, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 1370, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "こうして温まって\nいると、病気も\n治る気がします", 1371, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 1372, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "少食ですけど\nこれならたくさん\n食べられそうです", 1373, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103801, "続きが気になって\n読むのを止める\nタイミングが…", 1374, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "しっかり休まないと\n早く回復するように", 1376, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1377, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 1378, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1379, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1380, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "むかしむかしある所に\nシオリと\nあの人が…", 1381, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 103802, "あの人の\nためにも早く\n病気を治さないと…", 1382, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1383, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "新記録です！\n一週間連続、\n平熱を保ちました！", 1384, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 1385, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1386, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1387, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 103802, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1388, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 103802, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1389, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 103802, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 1390, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 103802, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 1391, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 1392, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "少し休もう\n…やっぱり\nたくさん休もう", 1393, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "この子がいれば\n病室に一人でも\n寂しくないですね", 1394, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 1395, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "こうして温まって\nいると、病気も\n治る気がします", 1396, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "私も、少しは\n体力をつけないと\nいけませんよね　", 1397, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "いっぱい食べて\n健康な体にならないと", 1398, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 103802, "続きが気になって\n読むのを止める\nタイミングが…", 1399, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1401, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "あ、忘れずに\nお花に水を\nあげなきゃ…", 1402, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1403, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1404, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1405, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 1406, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104001, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1407, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1408, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 1409, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 1410, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 1411, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 1412, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104001, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1413, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104001, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1414, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104001, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 1415, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104001, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 1416, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "私がもっと\n可愛ければ、\n友達できるかなあ？", 1417, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 1418, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "かわいいなあ。\nこの子とも\n友達になりたい…", 1419, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "いい香りです…\n精神統一して\n友達のイメトレ…", 1420, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "灯りを見てると、\n心がなごみます～", 1421, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1422, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 1423, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104001, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1424, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "友達作りは、焦らず\n慌てず、じっくりと…", 1426, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 1427, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1428, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "今度、みなさんと\nピクニックとか…\nいってみたいな", 1429, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "ぼっちでもいい\nたくましく育てば\n…なんて", 1430, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 1431, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104002, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1432, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1433, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 1434, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 1435, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 1436, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 1437, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104002, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1438, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104002, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1439, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104002, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 1440, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104002, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 1441, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "私…見た目\nそこまで変じゃ\nないですよね…？", 1442, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "ほわあ～…\nふかふかって\nいいものですね～", 1443, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "この子みたいな\nあいくるしさを\n目指したいです！", 1444, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "灯りを見てると\n心がなごみます～", 1445, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 1446, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "身体を鍛えて\nみなさんを\n守ります！", 1447, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1448, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104002, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1449, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1451, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1452, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1453, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1454, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "あとで曲を復習して\nおかないと…", 1455, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 1456, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104201, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1457, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1458, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 1459, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1460, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1461, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1462, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104201, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1463, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104201, "おはようございます♪\n少し歌の練習を\nしてきますね", 1464, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104201, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 1465, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104201, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 1466, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1467, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "歌の調子をよくする\nためには休息も\n必要ですよね…", 1468, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "この子たちを\n相手に練習して\nみようかな…♪", 1469, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1470, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1471, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "歌うためには\n体力づくりは\n欠かせません", 1472, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "歌った後は\nお腹が空いて\nしまうんです", 1473, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104201, "音楽について\n理論も勉強\nしないと…", 1474, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1476, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1477, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1478, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1479, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 1480, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1481, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104202, "私の中にある\n私だけの歌…\n作ってみようかな？", 1482, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1483, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1484, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "魔物退治ですか！？\n…違います？\n良かった…", 1485, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1486, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1487, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104202, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1488, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104202, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1489, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104202, "少し休んだら\n午後の練習に\n行ってきますね", 1490, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104202, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 1491, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1492, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 1493, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 1494, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1495, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1496, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 1497, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 1498, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104202, "読書は歌に\n新しい風を\n吹き込んでくれます", 1499, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "店の新メニューでも\n考えるかな", 1501, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "あたしの店から、\n出前を届けようか？", 1502, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "パトロール、\nパトロール…\nここは異常なしかな？", 1503, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1504, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "のんびりし過ぎるのも\n…性に合わねぇな", 1505, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 1506, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104301, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1507, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1508, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "天気がいい日は\n外で運動したく\nならねぇか？", 1509, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "腹減ったか？　なんか\n作ってやろうか？", 1510, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 1511, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 1512, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104301, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1513, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104301, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1514, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104301, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1515, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104301, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 1516, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "た、たまにはその…\nかわいい格好とか\nしても…", 1517, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "ふわぁ、\n一休みすっかなぁ～", 1518, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "うっ！　か、かわいい\nじゃねぇか", 1519, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1520, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 1521, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "オラオラオラーーー！\n燃えるぜーーー！", 1522, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1523, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104301, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 1524, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "パトロール終了～\n本日も異常なしっと！", 1526, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "あたしの店から\n出前を届けようか？", 1527, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "あいつ、早く\n帰ってこないかな", 1528, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "あいつ\n腹すかせてないと\nいいんだけど…", 1529, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "のんびりし過ぎるのも\n…性に合わねぇな", 1530, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 1531, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104302, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1532, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 1533, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "天気がいい日は\n外で運動したく\nならねぇか？", 1534, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "腹減ったか？　なんか\n作ってやろうか？", 1535, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1536, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 1537, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104302, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1538, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104302, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 1539, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104302, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1540, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104302, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 1541, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "た、たまにはその…\nかわいい格好とか\nしても…", 1542, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "ふぅ～♪\n疲れがとれるな～", 1543, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "うっ！　か、かわいい\nじゃねぇか", 1544, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1545, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 1546, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "オラオラオラーーー！\n燃えるぜーーー！", 1547, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1548, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104302, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 1549, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "最近なにも\nしてくれません…\n焦らしてるんですね", 1551, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 1552, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 1553, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 1554, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1555, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 1556, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104501, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1557, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 1558, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 1559, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 1560, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 1561, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 1562, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104501, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 1563, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104501, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 1564, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104501, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 1565, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104501, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 1566, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 1567, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 1568, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1569, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 1570, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 1571, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 1572, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 1573, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104501, "この本の下に、\nそういう本を\nカムフラージュ？", 1574, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1576, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "最近なにも\nしてくれません…\n焦らしてるんですね", 1577, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "も、妄想が\n足りません…\n禁断症状がっ…！", 1578, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1579, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 1580, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 1581, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104502, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 1582, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 1583, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1584, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 1585, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 1586, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 1587, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104502, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 1588, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104502, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 1589, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104502, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 1590, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104502, "今夜は一晩中…\nなんですね？\nぐふふ…", 1591, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 1592, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 1593, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1594, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 1595, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 1596, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 1597, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "こんなにいっぱい\n入りません…\nお腹にっ！", 1598, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104502, "どんな本も\nよく見ると\nいやらしいです…！", 1599, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1601, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 1602, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 1603, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 1604, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 1605, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 1606, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104601, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 1607, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 1608, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 1609, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 1610, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 1611, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 1612, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104601, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 1613, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104601, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1614, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104601, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 1615, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104601, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 1616, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 1617, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "うにゃ～！\nお昼寝に\nぴったりにゃ", 1618, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 1619, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 1620, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 1621, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "本当は外で\n運動したいん\nだけどにゃ", 1622, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 1623, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104601, "ふむふむ…猫の\nしつけ方は、と…", 1624, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1626, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 1627, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 1628, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 1629, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 1630, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 1631, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104602, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 1632, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 1633, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 1634, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 1635, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 1636, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 1637, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104602, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 1638, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104602, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1639, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104602, "そろそろおっひる～\nにゃーんか\n食べたい…", 1640, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104602, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 1641, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "にゃにゃ…\n髪が乱れてるにゃ", 1642, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 1643, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 1644, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "猫でもこわくない\n優しい灯りにゃ！", 1645, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "ぽっかぽか\nしあわせな気分にゃ～", 1646, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 1647, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 1648, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104602, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 1649, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "内職手伝える人\nいないかしら？", 1651, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 1652, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "次の特売セールに\n向けて、しっかり\n準備しないと！", 1653, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 1654, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 1655, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 1656, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104801, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1657, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 1658, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 1659, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "背後の気配なら\nすぐ分かるわ\n試してみる？", 1660, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 1661, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1662, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104801, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 1663, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104801, "おはよう！\n今日も朝から\nバイトよ！", 1664, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104801, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 1665, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104801, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1666, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 1667, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "はぁ～バイトで\n疲れたから癒される～", 1668, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "これを内職で\n作ったら\n儲かるかしら？", 1669, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 1670, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 1671, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "働き続けるには\n健康第一！　それには\n運動が一番よ", 1672, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 1673, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104801, "日々絶えず学んで、\n生活に活かすのよ！", 1674, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1676, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 1677, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 1678, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 1679, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 1680, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1681, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104802, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 1682, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 1683, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 1684, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "今から\n休憩するところなの\n一緒にどう？", 1685, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "ん？　どうしたの？\n私のことが\n気になるの？", 1686, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 1687, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104802, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1688, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104802, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 1689, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104802, "お昼時ね\n少し休憩したら\nまた働くわよ！", 1690, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104802, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1691, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "女の子らしく…\nどうも忘れちゃう\nのよね", 1692, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "ここで少し\n休んだら\nまたバイトよ！", 1693, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "これを内職で\n作ったら\n儲かるかしら？", 1694, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 1695, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 1696, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 1697, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 1698, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104802, "日々絶えず学んで\n生活に活かすのよ！", 1699, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1701, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1702, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1703, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "くんくん、\n弟くんのにおい…\n近くにいるね？", 1704, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1705, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "この部屋を、\n私と弟くんの\n愛の巣に…", 1706, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104901, "はぁ～…弟くん\n禁断症状だよ～", 1707, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1708, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1709, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "姉と弟の外出は\nデートって\nいうのかな？", 1710, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "もう！\nイタズラする子には\nお姉ちゃんチョップ！", 1711, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪", 1712, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104901, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1713, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104901, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1714, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104901, "出かけるなら\n明るいうちに\n帰ってくるんだよ！", 1715, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104901, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆", 1716, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "きれいなお姉ちゃん\n好きだよね♪", 1717, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1718, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "かわいい♪\nお姉ちゃんチョップ！", 1719, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "この香り、\n弟くん好きかな？", 1720, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "これ、弟くんみたいに\nあったかいね～", 1721, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1722, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "あ、これ\n弟くんが好きな\n味付けだね！", 1723, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104901, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！", 1724, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1726, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1727, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "弟くんのお友達は\nみんな私の妹だよ♪", 1728, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1729, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "はっ！\n弟くんが困ってる\n気がする！", 1730, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "はぁ～…弟くん、\n禁断症状だよ～", 1731, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 104902, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1732, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "お姉ちゃん\nキミのお願いなら\nなんでも聞いて\nあげちゃうぞっ", 1733, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1734, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "お姉ちゃんの胸に\n飛び込んでおいでっ♪", 1735, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1736, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1737, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 104902, "お風呂にする？\nごはんにする？\nそれとも…うふふ♪", 1738, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 104902, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1739, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 104902, "お姉ちゃんが\nお昼ごはん\n作ってあげようか？", 1740, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 104902, "眠れないの？\nお姉ちゃんが子守歌\n歌ってあげるね！", 1741, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "弟くんを\n誘惑しちゃうぞ～♪", 1742, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1743, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "かわいい♪\nお姉ちゃんチョップ！", 1744, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "お肌に潤いが\nでてきたみたい～♪", 1745, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "これ、弟くんみたいに\nあったかいね～", 1746, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1747, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "弟くんの手作りなら\nもっとおいしくなると\n思うんだけどなぁ～", 1748, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 104902, "弟くんをきちんと\n教育するために\nお姉ちゃんは勉強を\nかかさないのだ☆", 1749, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "ん～、エレガントで\n大人なお部屋ね！\nアタシにぴったり！", 1751, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "身長とバスト以外は\n完璧な大人\nなのになぁ～", 1752, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "アタシの大人コーデで\nあいつも夢中ね♪", 1753, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "朝顔の観察したら\n理系女子になれる\nかしら？", 1754, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1755, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "大人っぽい子が\n多いわね…アタシも\n負けてられないわ！", 1756, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105001, "アタシが待ってる\nなんて、アイツは\n幸せものよねー", 1757, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "わーい、アメだー♪\n食べる食べるー♪", 1758, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "熱いハニーラテが\n飲みたーい！\n淹れてー淹れてー！", 1759, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "なによ？　もしかして\n好きな子にイタズラ\nしたくなるってやつ？", 1760, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ、\nデザインとかの話よ！", 1761, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1762, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105001, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1763, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105001, "朝のスキンケアは\n大事なの！", 1764, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105001, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1765, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105001, "エイジングケアを\nしないとねー", 1766, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "この角度のほうが\n大人っぽく見えるかな\nそれともこっちかしら", 1767, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1768, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "か、かわいい♪　けど\n大人はこんなもの…\nでも、かわいいし～！", 1769, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "オシャレ～♪\n大人なレディって\n感じよね♪", 1770, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "あったかーい♪\nここで宿題\nしようかしら？", 1771, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "運動したら成長\nしないかしら？\n背とか胸とか…", 1772, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "食べすぎると\n太っちゃうな…\nでも、おいしいし～っ", 1773, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105001, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1774, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1776, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "恋人にするなら\nイケメンか\nただイケよね～", 1777, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "もう少し背が欲しいな\n…もっと牛乳を\n飲まなくちゃ！", 1778, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "朝顔の観察したら\n理系女子になれる\nかしら？", 1779, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "こ、これは補習の\nお知らせプリント！\nアイツに見つかる前に\n隠さなくちゃ！", 1780, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "アイツおっそいなー\n別に会いたいわけじゃ\nないけど…\n来ないと気になる…", 1781, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105002, "アタシが待ってる\nなんて、アイツは\n幸せものよねー ", 1782, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "なーに？\nアタシに甘えたいの？", 1783, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ\nデザインとかの話よ！", 1784, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "頭撫でないで！\nお子様みたいに\nあつかわないでって\n言ってるのに～！", 1785, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "壁ドンの練習…\nあれ？　壁ドンって\n男がするんだっけ？", 1786, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1787, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105002, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1788, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105002, "レディの朝は\n忙しいのよ", 1789, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105002, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1790, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105002, "エイジングケアを\nしないとねー", 1791, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！", 1792, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1793, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "あたしがもっと\nオシャレにかわいく\nしてあげようか？", 1794, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "オシャレ～♪\n大人なレディって\n感じよね♪", 1795, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "あったかーい♪\nここで宿題\nしようかしら？", 1796, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "運動したら成長\nしないかしら？\n背とか胸とか…", 1797, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "レディは、食べ物にも\n気を使うのよ", 1798, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105002, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1799, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "魔法と科学\nどっちも極めて\nみせるわ", 1801, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "仕事も片付いたし\n部屋で\n実験実験…♪", 1802, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "たまった治療代の\n請求書を\nまとめないと…", 1803, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ", 1804, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね", 1805, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら", 1806, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105101, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1807, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "あら、ヒマなら\n薬草の整理を\n手伝って", 1808, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？", 1809, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "具合が悪い？\nなら診てあげる\nまずは触診から…", 1810, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…", 1811, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1812, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105101, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1813, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105101, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？", 1814, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105101, "あら、もうお昼？\nそろそろ一息\n入れましょうか", 1815, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105101, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？", 1816, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "医者たるもの\nいつだって\n清潔に…♪", 1817, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "いいわねこれ\n仮眠の時に\n使わせてもらうわ", 1818, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "ぬいぐるみなら\n動物も…", 1819, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "いい香り…\n仕事場にも\n置いてみようかしら", 1820, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "ここにいると\nついウトウト\nしちゃうわ…", 1821, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね", 1822, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "研究していると\nつい食べるのを\n忘れちゃうのよね", 1823, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105101, "実験もいいけど\nいつか成果を\n本にしないと…", 1824, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…", 1826, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？", 1827, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？", 1828, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "毒を薄めると\n薬になるのって\n今でも不思議だわ", 1829, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね", 1830, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪", 1831, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105102, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1832, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？", 1833, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから", 1834, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "欲しい薬が\nあったら言ってね\n調合してみるから", 1835, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる", 1836, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1837, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105102, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1838, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105102, "朝しか取れない\n植物があるの\n採取しに行くわよ", 1839, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105102, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ", 1840, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105102, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね", 1841, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "身なりについて\n研究するのも\n楽しそうね", 1842, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ", 1843, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "たまにはこういう\n可愛らしいものに\n触れないとね♪", 1844, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "いい香り…\n仕事場にも\n置いてみようかしら", 1845, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "仕事がなかったら\nこのまますーっと\n眠りたいのに…", 1846, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "運動しないと\n体型の維持が…", 1847, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "適度な食事も\n大切よね", 1848, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105102, "まさか私が\n恋愛読本を読む\n日が来るなんて…", 1849, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "ぺっぺっ！\n…い、いけないっ！", 1851, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "いっけな～い！\nひづめで床に傷が！", 1852, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！", 1853, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～", 1854, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "みんな、体重\nどれくらいなのかな？", 1855, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1856, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105201, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪", 1857, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪", 1858, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？", 1859, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？", 1860, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "力仕事ならまかせて！", 1861, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1862, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105201, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1863, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105201, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1864, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105201, "ランチは\nおしゃれなカフェで\nしてみたいな～♪", 1865, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105201, "お肌のケアに\nパックしながら\n寝ようかな～", 1866, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "やだっ、\nまた寝ぐせついてる！\n直さないと！", 1867, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "ミシッっていった！\n私、重すぎるかも！？", 1868, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "あ！　あなたも\n美人さんね～♪", 1869, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…", 1870, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも", 1871, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "な、なんだか野生に\n帰っちゃいそう！", 1872, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！", 1873, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105201, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1874, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～", 1876, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？", 1877, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "動物苑…って\n嫌なギルド名ね…", 1878, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！", 1879, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪", 1880, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1881, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105202, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？", 1882, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！", 1883, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "どうしたの？\n急に抱きついてきて…\n癒されたいの？", 1884, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "ぺっぺっ！\n…い、いけないっ！", 1885, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね", 1886, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1887, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105202, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1888, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105202, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1889, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105202, "ダイエット中だから\nお昼は抜いてるの～", 1890, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105202, "お肌のケアに\nパックしながら\n寝ようかな～", 1891, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！", 1892, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "ミシッっていった！\n私、重すぎるかも！？", 1893, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "あ！　あなたも\n美人さんね～♪", 1894, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～", 1895, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！", 1896, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "な、なんだか野生に\n帰っちゃいそう！", 1897, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "何を食べるかより\n誰と食べるかが\n大事なのよね", 1898, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105202, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1899, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！", 1901, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "私は子供ではない…！\nが、お菓子は\nいただこう！", 1902, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ", 1903, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…", 1904, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1905, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！", 1906, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105301, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…", 1907, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？", 1908, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1909, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！", 1910, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "私ともっと高く、\n共に飛ぼう！", 1911, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ", 1912, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105301, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ", 1913, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105301, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！", 1914, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105301, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな", 1915, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105301, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…", 1916, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな", 1917, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1918, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1919, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…", 1920, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1921, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！", 1922, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！", 1923, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105301, "これを読んで、新たな\n戦術を編み出すぞっ！", 1924, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ", 1926, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…", 1927, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1928, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1929, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！", 1930, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "あいつは今頃、何を\nしているのだろうな…\nふふっ", 1931, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105302, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…", 1932, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？", 1933, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！", 1934, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…", 1935, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！", 1936, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか", 1937, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105302, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ", 1938, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105302, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！", 1939, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105302, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか", 1940, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105302, "寝る前に…あと少し\nだけ、鍛錬を…", 1941, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては", 1942, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1943, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1944, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…", 1945, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1946, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！", 1947, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！", 1948, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105302, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな", 1949, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "私たちの騎空艇\nどんなデザインに\nしよう…？", 1951, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "団員募集の\nポスター\n作ろうっと♪", 1952, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "父さん…\n今頃どこで\n何してるんだろ？", 1953, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな", 1954, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "父さん以上の\n世界一の\n騎空士になりたい！", 1955, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ", 1956, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105701, "父さん…\n私にもね、大切な\n仲間ができたよ", 1957, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "仕事の依頼？\nすぐに支度\nしてくるね！", 1958, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！", 1959, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "なーにー？\nどうしたの？\n今呼んだよね？", 1960, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて", 1961, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！", 1962, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105701, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！", 1963, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105701, "おはよう！\n体の調子はどう？\n今日は頑張れそう？", 1964, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105701, "ねえねえ、お昼\n食べに行こうよ！\nお腹空いちゃった", 1965, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105701, "…あれ？\nおしゃべりしてたら\nもうこんな時間？", 1966, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "どうせならオシャレな\n騎空士って\n呼ばれたいな", 1967, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "ふぅ、疲れた～…\nちょっとだけ\n休んじゃおっと", 1968, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "よし！　キミは\n今から団長代理だ！\n…なんてね♪", 1969, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "いい香り～♪\n気持ちが\n落ち着く～…", 1970, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "これって\n騎空艇に\n置けるかな…？", 1971, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "どんな仕事でも\nこなせるような\n体力がないとね…！", 1972, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "あむっ…うん！\n美味しい～！\n今度作ってみよう♪", 1973, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105701, "空を冒険するには\n色んなことを\n知っておかないと…", 1974, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "…戻らなくなったよ\nどうすれば元に\n戻る…？", 1976, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "暇だよ…\nどこかに強い人は\nいないか？", 1977, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "ジョブチェンジ！\n…叫んでも\n戻らないよ", 1978, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "今のうちに、\n魔物退治の\n仕事に行くね！", 1979, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "ハァ～…\nうん、気の巡りは\n問題ないね！", 1980, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "私の力の源は\n仲間との\n絆だよ！", 1981, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105702, "いつかこの拳を\n空を越えた、星まで\n届かせたいね", 1982, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "功夫が足りない人は\nどうすればいいか？\nもちろん修行だよ！", 1983, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "私はいつも通りに\n喋ってるつもり\nだよ？", 1984, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "どうした？\nもしかして手合せ\nしたいか？", 1985, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "騎空士としても\n拳法家としても\n目指すは世界一ね！", 1986, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "背中はあなたに\n預けたよ！\nよろしくね！", 1987, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105702, "あなたと一緒なら\nきっと、今よりもっと\n強くなれるよ！", 1988, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105702, "ちゃんと起きてるか？\n寝ぼけてたら\nダメよ？", 1989, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105702, "腹減ったね…\nなにか食べに\n行くよ！", 1990, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105702, "修行のしすぎは\n良くないよ？\n気をつけるね", 1991, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "美しい技は\n美しい体が\nあってこそ！", 1992, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "よいしょっと…\nちょっとのんびり\nさせてもらうよ", 1993, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "…練習に\n使うのはさすがに\n可哀そうね", 1994, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "これは…\n瞑想の時にも\n使ってみたいね", 1995, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "出来ればもっと\n熱いほうが\n嬉しいよ", 1996, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "ここでも\n修行出来るなんて\n最高だよ！", 1997, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "気力の源は体力！\n体力の源は\n健康とご飯！", 1998, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105702, "んー…\n難しいことは\nわかんないよ！", 1999, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "わたしたちの\nギルドハウスへ\nようこそ～！", 2001, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "ぐるるる～…\nあ、お腹が\n鳴っちゃいました…", 2002, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "ん？\n食べ物のにおい？", 2003, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "みんなと仲良く食卓を\n囲みたいですね～", 2004, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "この部屋が、わたしの\n帰る場所です♪", 2005, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "あの人を見ると\n胸が満たされます～\nお腹は空いてますが！", 2006, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105801, "あの人、\n大食いの子って\n嫌いかな？", 2007, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "食べもの、くれるん\nですか？　わーい！\n恋しちゃいそう♪", 2008, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "つ、つまみ食いなんて\nしてませんよ？\nこれは味見です！", 2009, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "おやつは別腹、\nごはんも別腹、\n魔物も別腹～", 2010, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "好きなものを、\n好きな人達と食べる！\n最高の贅沢ですね☆", 2011, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "あなたは、\nごはん王子ですね～", 2012, 1, 4, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105801, "大好きです～\n愛してます～\nえへへ～♪", 2013, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105801, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2014, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105801, "お昼ご飯、\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2015, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105801, "お夕飯も、晩ごはんも\n食べたし…さぁ！\nお夜食の時間ですよ☆", 2016, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "身だしなみ、\n身だしなみ…\nきちんとしないとね♪", 2017, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "ふい～\n消化中です～", 2018, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "おいしそ…\nか、かわいいです～", 2019, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "いい香りですね～\n空気までおいしそう～\nじゅるり♪", 2020, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "ほっかほか～♪\n魔物の丸焼きが\n作れちゃいますね！", 2021, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "走って食べて！\n走って食べて！\n\この無限ループです！", 2022, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "いくつでも\n食べられますよ！\n幸せ～☆", 2023, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105801, "料理の絵を\n見ているだけで、\nよ、よだれが～", 2024, 1, 1, 8);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "この部屋が、わたしの\n帰る場所です♪", 2026, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "ギルドハウス\nどんどん素敵に\nなっていくな～♪", 2027, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "「やばい」とか\n「おいっす」とか…\n民の言葉って難しい", 2028, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "お菓子の家に\n住みたいな～", 2029, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "あ、頼んでた出前が\n届いたかな？", 2030, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "大切な人がいて\n大切な場所がある\nすごく幸せです♪", 2031, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 1, 105802, "あの人\n大食いの子って\n嫌いかな？", 2032, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "ごはんに行きますか？\n作りましょうか？\n店屋物もいいですね～", 2033, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "モグモグ…\nあげませんよ～", 2034, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "おやつは別腹\nごはんも別腹\n魔物も別腹～", 2035, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "好きなものを\n好きな人達と食べる！\n最高の贅沢ですね☆", 2036, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "大好きです～\n愛してます～\nえへへ～♪", 2037, 1, 8, 101);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 2, 105802, "わたし食べても\n太らないんです♪\nほらほら～触って\nみてくださいよ～", 2038, 1, 8, 102);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (1, 0, 2, 105802, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2039, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (2, 0, 2, 105802, "お昼ご飯\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2040, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (3, 0, 2, 105802, "お夕飯も、晩ごはんも\n食べたし～。さぁ！\nお夜食の時間ですよ☆", 2041, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "お姫さまみたいに\nきれいに\nならないと…", 2042, 1, 1, 1);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "のんびりしていても\nお腹がすいちゃうん\nですよね～", 2043, 1, 1, 2);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "おいしそ…\nか、かわいいです～", 2044, 1, 1, 3);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "アップル系、ピーチ系\nオレンジ系…\n香りも色々ですね～", 2045, 1, 1, 4);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "ここでお魚を\n焼けたら\n最高ですね～♪", 2046, 1, 1, 5);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "身体も鍛えなきゃ～！\nお腹がすいちゃいます\nけど…", 2047, 1, 1, 6);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "もぐもぐもぐもぐもぐ\nもぐもぐもぐもぐもぐ\nもぐもぐもぐもぐ…", 2048, 1, 1, 7);
INSERT INTO `v1_66003467ee6171067295ea5b0efc654406aad8e9459552c77231e21f67ce26d7` VALUES (0, 0, 3, 105802, "流行語発表…\nこんな言葉遣いが！\nやばいですね", 2049, 1, 1, 8);
